-- Table: background_rapido
CREATE TABLE background_rapido (id INTEGER PRIMARY KEY AUTOINCREMENT, url TEXT, diretorio TEXT, inicial VARCHAR (1) DEFAULT N);

-- Table: biblia_livros
CREATE TABLE biblia_livros (id INTEGER PRIMARY KEY AUTOINCREMENT, nome VARCHAR (100), nome2 VARCHAR (100));

-- Table: cat_biblia
CREATE TABLE cat_biblia (id INTEGER PRIMARY KEY AUTOINCREMENT, nome VARCHAR (50), nome2 VARCHAR (50), url TEXT);

-- Table: cat_musicas
CREATE TABLE cat_musicas (id INTEGER PRIMARY KEY AUTOINCREMENT, nome VARCHAR (50), nome2 VARCHAR (50));

-- Table: musica
CREATE TABLE musica (id INTEGER PRIMARY KEY AUTOINCREMENT, cat VARCHAR (11) REFERENCES cat_musicas (id), nome VARCHAR (100), nome2 VARCHAR (100), artista VARCHAR (100), compositor VARCHAR (150));

-- Table: musica_versos
CREATE TABLE musica_versos (id INTEGER PRIMARY KEY AUTOINCREMENT, musica VARCHAR (11) REFERENCES musica (id), verso TEXT);

-- Table: system
CREATE TABLE system (id INTEGER PRIMARY KEY AUTOINCREMENT, os VARCHAR (32) DEFAULT (0), hd VARCHAR (32) DEFAULT (0), mac VARCHAR (32) DEFAULT (0), chave VARCHAR (32) DEFAULT (0), serial VARCHAR (32) DEFAULT (0));

-- Table: tela
CREATE TABLE tela (id INTEGER PRIMARY KEY AUTOINCREMENT, tipo VARCHAR (13) DEFAULT padrao, largura INT (5) DEFAULT (0), altura INT (5) DEFAULT (0));
